import React from 'react';
import { Grid, Typography } from '@mui/material';
import { Link } from 'react-router-dom';
import data from '../data.json';
import NewsCard from '../componentes/NewsCard';
import MatchCard from '../componentes/MatchCard';
import 'flag-icons/css/flag-icons.min.css';
import posiciones from "../posiciones.js";
import resultados from "../resultados.js";
import goleadores from "../goleadores.js";

const Home = () => {
  const { news = [], upcomingMatches = [] } = data; // Asegura que news y upcomingMatches son arrays vacíos si están indefinidos
  const goleadoresData = goleadores.goleadores || [];  // Accede al arreglo de goleadores correctamente

  return (
    <Grid container spacing={2}>
      {/* Noticias destacadas */}
      <Grid item xs={12}>
        <Typography variant="h5" gutterBottom>Noticias destacadas</Typography>
        <Grid container spacing={2}>
          {news.map(article => (
            <Grid item xs={12} sm={6} md={4} key={article.id}>
              <a href={article.link} target="_blank" rel="noopener noreferrer" style={{ textDecoration: 'none' }}>
                <NewsCard article={article} />
              </a>
            </Grid>
          ))}
        </Grid>
      </Grid>

      {/* Partidos de la Copa América */}
      <Grid item xs={12}>
        <Typography variant="h5" gutterBottom>Partidos de la Copa América</Typography>
        <Grid container spacing={2}>
          {upcomingMatches.map(match => (
            <Grid item xs={12} sm={6} md={4} key={match.id}>
              <div style={{ display: 'flex', alignItems: 'center' }}>
                <span className={`fi fi-${match.team1FlagCode}`} style={{ fontSize: '2em', marginRight: '10px', marginLeft: '10px' }}></span>
                <Link to={`/match/${match.id}`} style={{ textDecoration: 'none', color: 'inherit' }}>
                  <MatchCard match={match} />
                </Link>
                <span className={`fi fi-${match.team2FlagCode}`} style={{ fontSize: '2em', marginRight: '10px', marginLeft: '10px' }}></span>
              </div>
            </Grid>
          ))}
        </Grid>
      </Grid>

      {/* Estadísticas */}
      <Grid item xs={12}>
        <Typography variant="h5" gutterBottom>Estadísticas</Typography>
        <Grid container spacing={2}>
          {/* Posiciones */}
          <Grid item xs={12} sm={6} md={4}>
            <Link to="/positions" style={{ textDecoration: 'none', color: 'inherit' }}>
              <Typography variant="h6">Posiciones</Typography>
              <Typography variant="body2">Tabla de posiciones de la Copa America:</Typography>
              <ul>
                {posiciones.grupos.map(grupo => (
                  <li key={grupo.nombre}>
                    <Typography variant="subtitle1">{grupo.nombre}</Typography>
                    <ul>
                      {grupo.equipos.map(equipo => (
                        <li key={equipo.nombre}>
                          {equipo.nombre} - Pts: {equipo.estadisticas.puntos}, PJ: {equipo.estadisticas.partidos_jugados}, PG: {equipo.estadisticas.ganados}, PE: {equipo.estadisticas.empatados}, PP: {equipo.estadisticas.perdidos}, GF: {equipo.estadisticas.goles_favor}, GC: {equipo.estadisticas.goles_contra}, DF: {equipo.estadisticas.diferencia_goles}
                        </li>
                      ))}
                    </ul>
                  </li>
                ))}
              </ul>
            </Link>
          </Grid>

          {/* Goleadores */}
          <Grid item xs={12} sm={6} md={4}>
            <Link to="/topscorers" style={{ textDecoration: 'none', color: 'inherit' }}>
              <Typography variant="h6">Goleadores</Typography>
              <Typography variant="body2">Tabla de goleadores:</Typography>
              <ul>
                {goleadoresData.map(jugador => (
                  <li key={jugador.nombre}>
                    {jugador.nombre} - Goles: {jugador.estadísticas.goles_totales}, Equipo: {jugador.equipo}
                  </li>
                ))}
              </ul>
            </Link>
          </Grid>

          {/* Resultados */}
          <Grid item xs={12} sm={6} md={4}>
            <Link to="/results" style={{ textDecoration: 'none', color: 'inherit' }}>
              <Typography variant="h6">Resultados</Typography>
              <Typography variant="body2">Resultados de todas las fechas:</Typography>
              <ul>
                {(resultados || []).map(partido => (
                  <li key={partido.id}>
                    {partido.equipo1} {partido.goles1} - {partido.goles2} {partido.equipo2} ({partido.fecha})
                  </li>
                ))}
              </ul>
            </Link>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
};

export default Home;
